import React, { Component } from "react";

class Heart extends Component {
	render() {
		return (
			<div>
				<button
					onClick={() => this.props.onClick()}
					className='fa fa-heart dark-gray'
					aria-hidden='buttonState'></button>
			</div>
		);
	}
}

export default Heart;
